import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const ProductScreen = () => {
  return (
    <View>
      <Text>ProductScreen</Text>
    </View>
  )
}

export default ProductScreen

const styles = StyleSheet.create({})
